import React from 'react';
import NewUser from './components/User/NewUser';
import UserList from './components/User/UserList';


function App() {
  const users = [
    {
      name: "Emre",
      age: 25
    },
    {
      name: "Ceren",
      age: 22
    }
  ]
  return (
    <div>
      <NewUser />
      <UserList users={users}/>
    </div>
  );
}

export default App;
